import React from 'react';
import './bot.css';

import SimpleSlider from "./carousel/carousel";


const Bot = props => {

    const settings = {
        infinite: true,
        arrow: true,
        speed: 500,
        slidesToShow: 4,
        slidesToScroll: 1
    };

    return (

        <div className="bot">
            <SimpleSlider/>
        </div>
    )
};

export default Bot;
